import React from "react";
function NotFoundPage() {
  return (
    <div className="container-fluid">
      <div className="row">
        <div className="text-center mt-5">
          <h1>404</h1>
          <h3>Halaman Tidak Ditemukan</h3>
        </div>
      </div>
    </div>
  );
}

export default NotFoundPage;
